  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains time series moored
  buoy data collected in thenBering Sea by Pacific Marine Environmental Laboratory
  (PMEL) during thenperiod of September 8, 1975 to July 28, 1982. The data consists
  ofnpressure and temperature readings. The original tape was in ASCII formatnand
  is currently available in the NODC format. These data were collectednas part of
  the Outer Continental Shelf Environmental Assessment Programn(OCSEAP) project conducted
  by National Oceanic and AtmosphericnAdministration (NOAA). Principal Investigator
  for this study was Dr.nJames D. Schumacher.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
